import { Popup } from 'react-map-gl';
import { Descriptions } from 'antd';

function EventInfo(props) {
  return (
    <Popup
      longitude={Number(props.longitude)}
      latitude={Number(props.latitude)}
      onClose={props.onClose}
    >
      <Descriptions title="Event Info">
      <Descriptions.Item label="Port">{props.properties.Port}</Descriptions.Item>
      <Descriptions.Item label="Duration">{props.properties.duration}</Descriptions.Item>
      <Descriptions.Item label="Event Id">{props.properties.event_id}</Descriptions.Item>
      </Descriptions>
    </Popup>
  )
}

export default EventInfo;
